package main

import (
	"fmt"
	"github.com/Alaarafeh/go-training/utils"
	"unicode"
)

var input = ""

func main() {
	utils.Blah()
	runes := []rune(input)
	runes = alchemicalReduction(runes)
	fmt.Println(string(runes))
	fmt.Println(len(runes))
}

func alchemicalReduction(runes []rune) []rune {

	i := 0
	for _, v := range runes {
		if i == len(runes)-1 {
			return runes
		}

		if unicode.ToUpper(v) == runes[i+1] || v == unicode.ToUpper(runes[i+1]) {
			destroyUnit(&runes, i)

			return alchemicalReduction(runes)
		}
		i++
	}

	return runes
}

func destroyUnit(input *[]rune, index int) {
	*input = deleteElement(*input, index)
	*input = deleteElement(*input, index)
}

func deleteElement(a []rune, i int) []rune {
	return append(a[:i], a[i+1:]...)
}
